!

!
version 12.4
service timestamps debug datetime msec
service timestamps log datetime msec
no service password-encryption
!
hostname R11
!
boot-start-marker
boot-end-marker
!
!
no aaa new-model
memory-size iomem 5
no ip icmp rate-limit unreachable
!
!
ip cef
no ip domain lookup
!
!
multilink bundle-name authenticated
!
!
!
!
!
!
!
!
!
!
!
!
!
!
archive
 log config
  hidekeys
! 
!
!
!
ip tcp synwait-time 5
!
!
!
!
interface Loopback0
 ip address 203.0.113.11 255.255.255.0
!
interface FastEthernet0/0
 ip address 200.200.200.246 255.255.255.252
 duplex auto
 speed auto
!
interface FastEthernet0/1
 ip address 200.200.200.217 255.255.255.248
 duplex auto
 speed auto
!
interface FastEthernet1/0
 ip address 200.200.200.225 255.255.255.248
 duplex auto
 speed auto
!
interface FastEthernet2/0
 ip address 200.200.200.209 255.255.255.248
 duplex auto
 speed auto
!
interface FastEthernet3/0
 ip address 200.200.200.193 255.255.255.240
 duplex auto
 speed auto
!
interface FastEthernet4/0
 no ip address
 shutdown
 duplex auto
 speed auto
!
interface FastEthernet5/0
 no ip address
 shutdown
 duplex auto
 speed auto
!
interface FastEthernet6/0
 no ip address
 shutdown
 duplex auto
 speed auto
!
!
router ospf 1
 log-adjacency-changes
 redistribute static subnets
 network 200.200.200.192 0.0.0.15 area 1
 network 200.200.200.208 0.0.0.7 area 1
 network 200.200.200.216 0.0.0.7 area 1
 network 200.200.200.224 0.0.0.7 area 1
 network 200.200.200.244 0.0.0.3 area 1
!
no ip http server
no ip http secure-server
ip forward-protocol nd
!
!
!
no cdp log mismatch duplex
!
!
!
!
control-plane
!
!
!
!
!
!
!
!
!
line con 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line aux 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line vty 0 4
 login
!
!
end
